full_text:
@stephenRB4 Morning... rainy and miserable in Pretoria too, but at least it's nice and light! I'm not a fan of this weather, so I'm counting the feather stash in Goldilox's office instead. 

She is not pleased. 

Apparently, these are not MY feathers. They are for her dreamcatchers. Gah!

@TSauerback Take care of you. 
Drink lots of hot liquids to shove those nasty germs back down from your throat into your stomach so your stomach acids can demolish them.
Ye gads! I'm clever for a cat, hey?

@MissBabington Wahahahahaha, DUDE! You look so dumb. 
Although the colour suits you. 
If Goldilox tried to do that to me I'd kill her whilst she slumbered.

@ohiowa89 Very clever.
How many cats does it take to catch a mouse?
Two. Mr Edge to catch it and me to steal it from him.

@JohnMoot1 That's so nice - the saying I mean.

New writers: offer advice, don't criticize and be patient, I guess we were all young and eager at some stage. 

Although TBH, I'm done buying indie books for the moment - last 4 were terrible, 2 of them I could not read past page 10. I tried.

Thanks Melisa.
Favourites...
Animal - giraffe
Word : jobbernowl
Series : Offspring (so sad I've watched them all now)
Colour : Yellow - that orangy yellow - not the pale sickly yellow.

@Faye_E_Arcand 
@writers_joy 
@shivani_1970 
If you've already done this - ignore. https://t.co/yMBJLSFuMn

