full_text:
@stephenRB4 Probably not.

I wrote 'Sibo Stays Healthy' during COVID-19 lockdown in South Africa and it is currently being used in an on-line education project with a local university. 
Kids are also sick of the topic. https://t.co/nN3hdsTuVw

@CloverErotica Para 2. 
Thinks...Feh! Disgusting human. Don't you dare touch me with that! Hisses and spits at intruder, then
Jack the hooligancat charges out the window and up the nearest tree.

@LydiaLoeber Sorry, hope you feel better soon. Lots of Vit. C. 
Somehow we managed to navigate COVID-19 &amp; the SA winter without a single cold or cough in our house (6 people &amp; a 9-month-old baby). Probably because we stayed home.
Now everybody is sneezing and snorting from allergies. Lol.

@StoneyD #DailyGratitude my daughter's significant other got a part-time job. He's been laying low since just after lockdown.
The bugs haven't eaten my seeds yet.
It's going to rain in Pretoria tomorrow... let's see.

@TheNicoleNeuman @WittyMystic @CatrinaOsgood ‚ÄúTo my Sis, Liza, Protector of Dogs, Little Bros and 
other unfortunate creatures.‚Äù
In the space of a couple of years' Liza's brother, father and mother all passed away. She was really down. This was like her brother lifting her up from the grave.

I need a break! Have decided that I am going to escape to Wigwash. If you haven't read the first one yet you better do so quickly because the second is coming.
https://t.co/BBm3mSbfMo
@WizardofWigwash

@StoneyD I'm thankful that summer is here. 
That Jack the #hooligancat only put one paw print in the cement path I made yesterday. 
That Pete, my publisher is on the mend - after 4 very lonely weeks in the hospital.

@JaeMargal What is old? 

I'll be 58 on Wednesday. 

When I was twenty-something I thought that was ancient. Now, compared to my 86 year old mom, I'm a spring chicken. It's all relative. I would not swap being young again for anything. https://t.co/nxzcO5D44f

@PeterJFoote1 Cat food
Cement
Calculator

@marianlthorpe Sleeping under a sheet. Wearing skimpy clothes instead of several layers. Flip-flops.
What do I not love? Mosquitoes!
But it is winter in Pretoria now, although our days are gorgeous and sunny, the nights and mornings are cold.
